'use strict';

if (typeof module !== 'undefined') module.exports = simpleheat;

function simpleheat(canvas)
{
    if (!(this instanceof simpleheat)) return new simpleheat(canvas);

    this._canvas = canvas = typeof canvas === 'string' ? document.getElementById(canvas) : canvas;
    this._ctx = canvas.getContext('2d');
    this._data = [];
}

simpleheat.prototype = {

    defaultGradient: {
        0.4: 'blue',
        0.6: 'cyan',
        0.7: 'lime',
        0.8: 'yellow',
        1.0: 'red'
    },

    data: function (data) {
        this._data = data;
        return this;
    },

    add: function (point) {
        this._data.push(point);
        return this;
    },

    clear: function () {
        this._data = [];
        return this;
    },

    _circle: function (r, blur, z)
    {
        // create a grayscale blurred circle image that we'll use for drawing points
        var circle = document.createElement('canvas');
        var ctx = circle.getContext('2d');
        //r = r / z;
        var r2 = r + blur;

        circle.width = circle.height = r2 * 2;

        ctx.shadowOffsetX = ctx.shadowOffsetY = r2 * 2;
        ctx.shadowBlur = blur;
        ctx.shadowColor = 'black';

        ctx.beginPath();
        ctx.arc(-r2, -r2, r, 0, Math.PI * 2, true);
        ctx.closePath();
        ctx.fill();

        return circle;
    },

    _gradient: function (grad) {
        // create a 256x1 gradient that we'll use to turn a grayscale heatmap into a colored one
        var canvas = document.createElement('canvas');
        var ctx = canvas.getContext('2d');
        var gradient = ctx.createLinearGradient(0, 0, 0, 256);

        canvas.width = 1;
        canvas.height = 256;

        for (var i in grad) {
            gradient.addColorStop(+i, grad[i]);
        }

        ctx.fillStyle = gradient;
        ctx.fillRect(0, 0, 1, 256);

        return ctx.getImageData(0, 0, 1, 256).data;
    },

    draw: function (max, minOpacity, radius, blur, zoom)
    {
        var circle = this._circle(radius, blur, zoom);
        var gradient = this._gradient(this.defaultGradient);

        var ctx = this._ctx;
        var w = this._canvas.width;
        var h = this._canvas.height;

        ctx.clearRect(0, 0, w, h);

        // draw a grayscale heatmap by putting a blurred circle at each data point
        for (var i = 0, len = this._data.length, p; i < len; i++) {
            p = this._data[i];
            ctx.globalAlpha = Math.max(p[2] / max, minOpacity);
            ctx.drawImage(circle, p[0] - (radius + blur), p[1] - (radius + blur));
        }

        // colorize the heatmap, using opacity value of each pixel to get the right color from our gradient
        var colored = ctx.getImageData(0, 0, w, h);
        this._colorize(colored.data, gradient);
        ctx.putImageData(colored, 0, 0);

        return this;
    },

    _colorize: function (pixels, gradient) {
        for (var i = 0, len = pixels.length, j; i < len; i += 4) {
            j = pixels[i + 3] * 4; // get gradient color from opacity value

            if (j) {
                pixels[i] = gradient[j];
                pixels[i + 1] = gradient[j + 1];
                pixels[i + 2] = gradient[j + 2];
            }
        }
    }
};

L.HeatCanvas = L.Canvas.extend({

  _initContainer: function () {
    L.Canvas.prototype._initContainer.call(this); // init this._ctx
    this._heat = simpleheat(this._container);
  },

  updateOptions: function (options)
  {
    this.options.radius = options.radius;
    this.options.max = options.max;
    this.options.maxZoom = options.maxZoom;
    this.options.minOpacity = options.minOpacity;
    this.options.blur = options.blur;
    this.options.gradient = options.gradient;
  },

  beforeAdd: function(layer)
  {
    this._layers = {};
    this._layers[L.stamp(layer)] = layer;
  },

  onAdd: function()
  {
    L.Renderer.prototype.onAdd.call(this);
  },

  removeLayer: function(layer)
  {
    var layerID = L.stamp(layer);
    delete layer._removed;
    delete this._layers[layerID];
  },

  _redraw: function ()
  {
    this._ctx.clearRect(0, 0, this._container.width, this._container.height);

    // Double Check Layers
    for (var id in this._layers)
    {
      layer = this._layers[id];
      if(layer._removed)
      {
        delete layer._removed;
        delete this._layers[L.stamp(layer)];
      }
		}

    for (var id in this._layers) {
			layer = this._layers[id];
      layer._project(); // Reloads layer._pxBounds and projected coordinates
      this._draw(layer, layer._pxBounds);
		}
  },

  _draw: function (layer, bounds)
  {
    this._ctx.save();
    if(bounds)
    {
      // Doesn't work.  Need to clip by canvas points, not project points
      //this._ctx.rect(bounds.min.x, bounds.min.y, bounds.max.x - bounds.min.x, bounds.max.y - bounds.min.y);
      //this._ctx.clip(); // Clips canvas
    }
    var heatMapData = this.buildHeatMapData(this.options.radius, layer);
    this._heat.data(heatMapData);
    this._heat.draw(
      this.options.max,
      this.options.minOpacity,
      this.options.radius,
      this.options.blur,
      this._map.getZoom());
    this._ctx.restore();
  },

  buildHeatMapData: function (r, layer) {
    if (!this._map) {
        return;
    }

    var latlngs = layer._latlngs;

    if(latlngs.length == 0)
    {
        return [];
    }

    var data = [];
    var size = this._map.getSize();
    var bounds = new L.Bounds(L.point([-r, -r]), size.add([r, r])); // The bounds of the container

    var max = this.options.max === undefined ? 1 : this.options.max;
    var maxZoom = this.options.maxZoom === undefined ? this._map.getMaxZoom() : this.options.maxZoom;
    var v = 1 / Math.pow(2, Math.max(0, Math.min(maxZoom - this._map.getZoom(), 12)));
    var cellSize = r / 2;

    var grid = [];
    var panePos = this._map._getMapPanePos();
    var offsetX = panePos.x % cellSize;
    var offsetY = panePos.y % cellSize;
    var i, len, p, cell, x, y, j, len2, k;

    // console.time('process');
    for (i = 0, len = latlngs.length; i < len; i++) {
        //p = this._map.latLngToContainerPoint(latlngs[i]);
        p = this._map.latLngToLayerPoint(latlngs[i]);
        if (bounds.contains(p))  // Check if point is within the container bounds
        {
            x = Math.floor((p.x - offsetX) / cellSize) + 2;
            y = Math.floor((p.y - offsetY) / cellSize) + 2;
            //k = latlngs[i][2] * v;
            k = latlngs[i][2];

            grid[y] = grid[y] || [];
            cell = grid[y][x];

            if (!cell)
            {
                grid[y][x] = [p.x, p.y, k];
            }
            else
            {
                //cell[0] = (cell[0] * cell[2] + p.x * k) / (cell[2] + k); // x
                //cell[1] = (cell[1] * cell[2] + p.y * k) / (cell[2] + k); // y
                cell[2] = cell[2] + k; // cumulated intensity value
            }
        }
    }

    for (i = 0, len = grid.length; i < len; i++) {
        if (grid[i]) {
            for (j = 0, len2 = grid[i].length; j < len2; j++) {
                cell = grid[i][j];
                if (cell) {
                    data.push([
                        Math.round(cell[0]),
                        Math.round(cell[1]),
                        Math.min(cell[2], max)
                    ]);
                }
            }
        }
    }
    return data;
  }
});

L.heatCanvas = function (options) {
	return L.Browser.canvas ? new L.HeatCanvas(options) : null;
};

L.HeatLayer = L.Path.extend({

  initialize: function (latlngs, options) {
    L.setOptions(this, options);

    this.options.minOpacity = this.options.minOpacity != undefined ? this.options.minOpacity : 0.05

    this._setLatLngs(latlngs);
	},

  beforeAdd: function (map) {
    this._renderer = map.getRenderer(this);
    this._renderer.updateOptions(this.options)
    L.HeatCanvas.prototype.beforeAdd.call(this._renderer, this);
	},

  onAdd: function() {
    L.HeatCanvas.prototype._redraw.call(this._renderer, this);
  },

  onRemove: function () {
		L.HeatCanvas.prototype.removeLayer.call(this._renderer, this);
    L.HeatCanvas.prototype._redraw.call(this._renderer, this);
	},

  _setLatLngs: function (latlngs) {
    this._bounds = new L.LatLngBounds();
    this._latlngs = this._convertLatLngs(latlngs);
    return this.redraw();
  },

  _convertLatLngs: function (latlngs) {
    var result = [];
    for (var i = 0, len = latlngs.length; i < len; i++)
    {
      result[i] = latlngs[i];
      this._bounds.extend(L.latLng(latlngs[i][0], latlngs[i][1]));
    }
    return result;
  },

  addLatLng: function (latlng, latlngs) {

    //latlngs = latlngs || this._defaultShape();
    latlngs = latlngs || this._latlngs;
    //latlng = L.latLng(latlng[0]);
    latlngs.push(latlng);
    this._bounds.extend(L.latLng(latlng[0], latlng[1]));
    return this.redraw();
  },


  getBounds: function () {
  	return this._bounds;
  },

  getLatLngs: function () {
		return this._latlngs;
	},

  isEmpty: function () {
		return !this._latlngs.length;
	},

  getCenter: function ()
  {
    var points = this._latlngs;
    var x = 0;
    var y = 0;
    for(var i = 0; i < points.length; i++)
    {
        x += points[i][0];
        y += points[i][1];
    }
    var center = [x / points.length , y / points.length ];
    return this._map.layerPointToLatLng(center);
  },

  _project: function () {
    var pxBounds = new L.Bounds();
    this._rings = [];
    this._projectLatlngs(this._latlngs, this._rings, pxBounds);

    var w = this._clickTolerance();
    var p = new L.Point(w, w);

    if (this._bounds.isValid() && pxBounds.isValid())
    {
      pxBounds.min._subtract(p);
      pxBounds.max._add(p);
      this._pxBounds = pxBounds;
    }
	},

	_projectLatlngs: function (latlngs, result, projectedBounds)
  {
    var ring = [];
		for (var i = 0; i < latlngs.length; i++)
    {
			ring[i] = this._map.latLngToLayerPoint(latlngs[i]);
			projectedBounds.extend(ring[i]);
		}
		result.push(ring);
	},

  _update: function () {
    if (!this._map) { return; }
    this._renderer._redraw();
  }

});

L.heatLayer = function (latlngs, options) {
    return new L.HeatLayer(latlngs, options);
};

